import React, { useEffect } from "react";
import styled from "styled-components";
import { InnerLayout } from "../../styles/Layouts";
import Chart from "../Chart/Chart";
import { pound } from "../../utils/Icons";
import { useGlobalContext } from "../../context/globalContext";
import History from "../../History/History";

// Dashboard component
function Dashboard() {
  const {
    totalExpenses,
    incomes,
    expenses,
    totalIncome,
    totalBalance,
    getIncomes,
    getExpenses,
  } = useGlobalContext(); // Accessing data from global context

  useEffect(() => {
    // Fetching incomes and expenses when component mounts
    getIncomes();
    getExpenses();
  }, []); // Empty dependency array ensures useEffect runs only once, similar to componentDidMount
  return (
    // Styled container for Dashboard
    <DashboardStyled>
      <InnerLayout>
        <h1>All Transactions</h1>
        <div className="stats-con">
          {/* Section for displaying charts and statistics */}
          <div className="chart-con">
            <Chart /> {/* Displaying Chart component */}
            {/* Section for displaying income, expense, and balance */}
            <div className="amount-con">
              <div className="income">
                <h2>Total Income</h2>
                <p>
                  {pound} {totalIncome()}
                </p>
              </div>
              <div className="expense">
                <h2>Total Expense</h2>
                <p>
                  {pound} {totalExpenses()}
                </p>
              </div>
              <div className="balance">
                <h2>Total Balance</h2>
                <p>
                  {pound} {totalBalance()}
                </p>
              </div>
            </div>
          </div>
          {/* Section for displaying history of transactions */}
          <div className="history-con">
            <History /> {/* Displaying History component */}
            {/* Displaying minimum and maximum salary */}
            <h2 className="salary-title">
              Min <span>Salary</span>Max
            </h2>
            <div className="salary-item">
              <p>{Math.min(...incomes.map((item) => item.amount))}</p>
              <p>{Math.max(...incomes.map((item) => item.amount))}</p>
            </div>
            {/* Displaying minimum and maximum expense */}
            <h2 className="salary-title">
              Min <span>Expense</span>Max
            </h2>
            <div className="salary-item">
              <p>{Math.min(...expenses.map((item) => item.amount))}</p>
              <p>{Math.max(...expenses.map((item) => item.amount))}</p>
            </div>
          </div>
        </div>
      </InnerLayout>
    </DashboardStyled>
  );
}

// Styled container for Dashboard layout
const DashboardStyled = styled.div`
  /* Styles for the layout and arrangement of elements */

  /* Styles for the section containing statistics and charts */
  .stats-con {
    display: grid;
    grid-template-columns: repeat(5, 1fr);
    gap: 2rem;

    /* Styles for the chart container */
    .chart-con {
      grid-column: 1 / 4;
      height: 400px;
      /* Styles for the container of income, expense, and balance */
      .amount-con {
        display: grid;
        grid-template-columns: repeat(4, 1fr);
        gap: 2rem;
        margin-top: 2rem;
        /* Styles for income, expense, and balance sections */
        .income,
        .expense {
          grid-column: span 2;
        }
        .income,
        .expense,
        .balance {
          background: #fcf6f9;
          border: 2px solid #ffffff;
          box-shadow: 0px 1px 15px rgba(0, 0, 0, 0.06);
          border-radius: 20px;
          padding: 1rem;
          p {
            font-size: 3.5rem;
            font-weight: 700;
          }
        }
        /* Styles for the balance section */
        .balance {
          grid-column: 2 / 4;
          display: flex;
          flex-direction: column;
          justify-content: center;
          align-items: center;
          p {
            color: var(--color-green);
            opacity: 0.6;
            font-size: 4.5rem;
          }
        }
      }
    }
    /* Styles for the section containing transaction history */
    .history-con {
      grid-column: 4 / -1;

      /* Styles for headings */
      h2 {
        margin: 1rem 0;
        display: flex;
        align-items: center;
        justify-content: space-between;
      }

      /* Styles for salary and expense titles */
      .salary-title {
        font-size: 1.2rem;

        /* Styles for the span inside salary-title */
        span {
          font-size: 1.8rem;
        }
      }

      /* Styles for salary and expense items */
      .salary-item {
        background: #fcf6f9;
        border: 2px solid #ffffff;
        box-shadow: 0px 1px 15px rgba(0, 0, 0, 0.06);
        padding: 1rem;
        border-radius: 20px;
        display: flex;
        justify-content: space-between;
        align-items: center;
        p {
          font-weight: 600;
          font-size: 1.6rem;
        }
      }
    }
  }
`;
export default Dashboard; // Exporting the Dashboard styled component
